import React, { Component } from 'react';
import SearchedUsersDisplay from './SearchedUsersDisplay';

class Main extends Component {
  render() {
    const {userSearched, Error, currentUser} = this.props;
    return (
      <main>
        <SearchedUsersDisplay userSearched={userSearched} Error={Error} currentUser={currentUser}/>
      </main>
    );
  }
}

export default Main;
